import React from "react";
import Accueil from "./Accueil";
import Register from "./Register";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    withRouter,
    useParams
} from "react-router-dom";

// const {params } = useParams();
// console.log(this.props.hisotry);


class Routing extends React.Component{
    constructor(props){
        super(props)
    }

    render(){
        console.log(this.props.match.params);
        return(
            <Switch>
                <Route exact path="/" render={(props) => <Accueil {...props} category={localStorage.getItem("categoryFilter")}/>}/>
                <Route path="/register"><Register path={{pathname:"register"}}/></Route>/>
                <Route path="/signin"><Register path={{pathname:"signin"}}/></Route>/>
                <Route exact path="/filter/:category" render={(props) => <Accueil {...props} category="all"/>}/>
            </Switch>
        )
    }
}

export default withRouter(Routing)
